// Maximum Key Size
exports.MAX_BLOB_SIZE = 8192;
exports.MAX_CSUMSIZE = 64;

// Max block size of block ciphers
exports.MAX_BLOCK_SIZE = 256 / 8;
exports.AES_BLOCK_SIZE = 16;
exports.DES_BLOCK_SIZE = 8;

// Max digest output bytes
exports.MAX_DIGEST_BYTES = 512 / 8;

// MAX_DIGEST_STATE_BYTES is the maximum size of wrapped digest state blobs
//   -- Section 10.1 Function descriptions, EP11 design Document
exports.MAX_DIGEST_STATE_BYTES = 1024;
exports.MAX_CRYPT_STATE_BYTES  = 8192;
